import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import NavBar from './components/NavBar'
import Header from './components/Header'
import Content from './components/Content'
import Content2 from './components/Content2'
import Highlight from './components/Highlight'
import ECom from './components/pages/ECom';
import Logo from '../assets/logo.png';
import './styles/App.css';
import Menschen from './components/pages/Menschen';

export default function Dashboard() {
    return(
     <div className="wrapMain">
    <Router>
    <div className="navbar">
       <img className="logo" src={Logo}/>
       <div className="toolbar">
            <Route path="/" component={Home}/>
            <Route path="/" exact component={Menschen}></Route>
            <Route path="/ECom" component={ECom}></Route> 
            /* <Link className="link" to="/Menschen"><i id="icon" className="fas fa-users"></i><br></br>Menschen</Link>
            <br></br>
            
            <Link className="link" to="/ECom"><i id="icon" className="fas fa-shopping-cart"></i><br></br>ECommerce</Link> */
          
        </div>
      
    </div>
      <Switch>
       
     </Switch>
     </Router>
     <div className="placeholder1"></div>
     <div className="placeholder2"></div>
     <div className="placeholder3"></div>
     <Highlight überschrift="huhu" text="Yay!"></Highlight>
     <Header></Header>
     <Content></Content>
     <Content2></Content2>
     </div>
    );
   
}

const Home = () => (
    <div>
        <h3>Home Page</h3>
    </div>
);
